✔️Resumo de Ocorrência

 ✅3° CPA 21° BPM

📅Data: 08/01/2023

📝Cerco tático montado pelo 21°BPM prende dupla e apreende pistola Glock 9mm, munições, rádio comunicador e drogas na comunidade São Mateus em São João de Meriti.
Na ação, a motocicleta usada pelos criminosos também foi apreendida.

Ⓜ️Material Apreendido:

▫️01 Pistola Glock 9mm, numeração suprimida;
▫️17 munições;
▫️01 Carregador;
▫️farto material entorpecente a ser contabilizado;
▫️01 Rádio comunicador;
▫️01 motocicleta.

🚨A ocorrência deste domingo foi encaminhada à 64ª DP.
